import React from "react";
import TodoItem from "./TodoItem";

import styled from "styled-components";

const TodoList = () => {
  return (
    <TodoListContainer>
      <TodoItem></TodoItem>
    </TodoListContainer>
  );
};

const TodoListContainer = styled.ul((props) => {
  return {};
});

export default TodoList;
